import React from 'react';
import './MainContent.css';

const MainContent = () => {
  return (
    <div className="main-content">
      <h1>메인 콘텐츠</h1>
      <p>여기에 메인 콘텐츠를 추가하세요.</p>
    </div>
  );
};

export default MainContent;
